pragma solidity ^0.5.14;

import "../GSN/TokenLandiaWhitelistGSNRecipient.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";

contract TrustedNftEscrow is TokenLandiaWhitelistGSNRecipient, IERC721Receiver {

    event OwnershipTransferred(
        address indexed _nftAddress,
        uint256 indexed _tokenId,
        address indexed _recipient
    );

    event Received(
        address operator,
        address from,
        uint256 tokenId,
        bytes data,
        uint256 gas
    );

    function onERC721Received(address operator, address from, uint256 tokenId, bytes memory data) public returns (bytes4) {
        emit Received(operator, from, tokenId, data, gasleft());

        return this.onERC721Received.selector;
    }

    function isTokenEscrowed(address _nftAddress, uint256 _tokenId) external view returns (bool) {
        return IERC721(_nftAddress).ownerOf(_tokenId) == address(this);
    }

    function transferOwnership(address _nftAddress, uint256 _tokenId, address _recipient) onlyWhitelisted external {
        require(_recipient != address(0x0), "Cannot move token to zero address");
        require(IERC721(_nftAddress).ownerOf(_tokenId) == address(this), "Unable to move token which is now Escrowed");

        IERC721(_nftAddress).safeTransferFrom(address(this), _recipient, _tokenId, bytes(""));

        emit OwnershipTransferred(_nftAddress, _tokenId, _recipient);
    }

}
